iff, setequal, union\n","\n","\n","Warning message in system(\"timedatectl\", intern = TRUE):\n","“running command 'timedatectl' had status 1”\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}]},{"cell_type":"code","source":["df <- read.csv('/content/kind_prophet.csv')"],"metadata":{"id":"q2BGlblrOn3B","pycharm":{"name":"#%%\n"},"executionInfo":{"status":"ok","timestamp":1661283430893,"user_tz":300,"elapsed":10,"user":{"displayName":"Matthew Norris","userId":"17841799204930071289"}}},"execution_count":2,"outputs":[]},{"cell_type":"code","source":["# # to run prophet, there needs to be only two columns: ds, which is \n","# # formatted in YYYY-MM-DD format, and y, which is usually sales\n","# # for the model to be working correctly, date needs to be sorted in\n","# # descending order, then converted to POSIXct format. setting the\n","# # starting date, or origin, is absolutely necessary\n","# # all other columns can be dropped, nor need to be pivoted\n","\n","# # I ordered the file in advance, but the conversion to POSIXct is crucial\n","df <- df[order(df$ds),] # orders the df$ds column in ascending order\n","df$ds <- as.POSIXct(df$ds,\"%Y-%m-%d\", tz = \"UTC\", origin=\"2018-06-03\")"],"metadata":{"id":"t055c805moS2","executionInfo":{"status":"ok","timestamp":1661283430894,"user_tz":300,"elapsed":11,"user":{"displayName":"Matthew Norris","userId":"17841799204930071289"}}},"execution_count":3,"outputs":[]},{"cell_type":"markdown","source":["# New Section"],"metadata":{"id":"IPPw7MHDm1DW"}},{"cell_type":"code","source":["## I split up the files for testing, training, and holidays\n","df <- subset(df, ds > '2020-02-28' & ds < '2022-05-22')\n","df_train <- subset(df, ds > '2020-03-01' & ds < '2022-02-27')\n","df_test <- subset(df, ds > '2022-02-28' & ds < '2022-05-22')\n","\n","prophet_holidays <- read.csv('/content/prophet_holidays.csv')\n","prophet_holidays <- prophet_holidays[prophet_holidays$country == 'US', ]"],"metadata":{"id":"vSRBEgeMt_Dv","executionInfo":{"status":"ok","timestamp":1661283431188,"user_tz":300,"elapsed":305,"user":{"displayName":"Matthew Norris","userId":"17841799204930071289"}}},"execution_count":4,"outputs":[]},{"cell_type":"code","source":["m <- prophet(\n","    df_train,\n","    growth = \"linear\",\n","    # changepoints = NULL,\n","    # n.changepoints = 25,\n","    changepoint.range = 0.8,\n","    yearly.seasonality = TRUE, \n","    weekly.seasonality = TRUE, \n","    daily.seasonality = FALSE,\n","    holidays = prophet_holidays,\n","    seasonality.mode = \"additive\", \n","    seasonality.prior.scale = 10, \n","    holidays.prior.scale = 10, \n","    changepoint.prior.scale = .5,\n","    mcmc.samples = 800, \n","    interval.width = .20, \n","    uncertainty.samples = 200,\n","    fit = TRUE\n",")\n"],"metadata":{"id":"m86xt0jxcFTd","colab":{"base_uri":"https://localhost:8080/"},"executionInfo":{"status":"ok","timestamp":1661283581818,"user_tz":300,"elapsed":150631,"user":{"displayName":"Matthew Norris","userId":"17841799204930071289"}},"outputId":"35aa295b-e2eb-4245-8d1c-a61c84b167b0"},"execution_count":5,"outputs":[{"output_type":"stream","name":"stdout","text":["\n","SAMPLING FOR MODEL 'prophet' NOW (CHAIN 1).\n","Chain 1: \n","Chain 1: Gradient evaluation took 0.000183 seconds\n","Chain 1: 1000 transitions using 10 leapfrog steps per transition would take 1.83 seconds.\n","Chain 1: Adjust your expectations accordingly!\n","Chain 1: \n","Chain 1: \n","Chain 1: Iteration:   1 / 800 [  0%]  (Warmup)\n","Chain 1: Iteration:  80 / 800 [ 10%]  (Warmup)\n","Chain 1: Iteration: 160 / 800 [ 20%]  (Warmup)\n","Chain 1: Iteration: 240 / 800 [ 30%]  (Warmup)\n","Chain 1: Iteration: 320 / 800 [ 40%]  (Warmup)\n","Chain 1: Iteration: 400 / 800 [ 50%]  (Warmup)\n","Chain 1: Iteration: 401 / 800 [ 50%]  (Sampling)\n","Chain 1: Iteration: 480 / 800 [ 60%]  (Sampling)\n","Chain 1: Iteration: 560 