pe', rolling_window = .1)\n","plot_cross_validation_metric(cv, metric = 'smape', rolling_window = .1)\n","\n","# calculates a variet of statistics to estimate model quality, including \n","# mse, rmse, mae, mape, mdape, smape, coverage\n","pred_sample = predictive_samples(m, df_train)\n","twelve_wk_RMSE = sqrt(mean((pred_sample$trend-pred_sample$yhat)^2))\n","#### Creates two 12 week windows from the predicted and actual values\n","#### to be used to plot against each other and create more metrics\n","fcst_12 <- subset(fcst, ds > '2022-02-28' & ds < '2022-05-22')\n","fcst_12 <- fcst_12[,c('ds', 'yhat', 'yhat_lower', 'yhat_upper')]\n","names(fcst_12)[2] <- \"y\"\n","fcst_12$y_obs <- df_test$y"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":1000},"id":"oObgvilBuzqP","executionInfo":{"status":"ok","timestamp":1661284081234,"user_tz":300,"elapsed":483436,"user":{"displayName":"Matthew Norris","userId":"17841799204930071289"}},"outputId":"a7175f46-ee27-4fb6-8ef4-171692038cb4"},"execution_count":7,"outputs":[{"output_type":"stream","name":"stderr","text":["Making 4 forecasts with cutoffs between 2021-04-25 and 2022-01-02\n","\n"]},{"output_type":"stream","name":"stdout","text":["\n","SAMPLING FOR MODEL 'prophet' NOW (CHAIN 1).\n","Chain 1: \n","Chain 1: Gradient evaluation took 5.5e-05 seconds\n","Chain 1: 1000 transitions using 10 leapfrog steps per transition would take 0.55 seconds.\n","Chain 1: Adjust your expectations accordingly!\n","Chain 1: \n","Chain 1: \n","Chain 1: Iteration:   1 / 800 [  0%]  (Warmup)\n","Chain 1: Iteration:  80 / 800 [ 10%]  (Warmup)\n","Chain 1: Iteration: 160 / 800 [ 20%]  (Warmup)\n","Chain 1: Iteration: 240 / 800 [ 30%]  (Warmup)\n","Chain 1: Iteration: 320 / 800 [ 40%]  (Warmup)\n","Chain 1: Iteration: 400 / 800 [ 50%]  (Warmup)\n","Chain 1: Iteration: 401 / 800 [ 50%]  (Sampling)\n","Chain 1: Iteration: 480 / 800 [ 60%]  (Sampling)\n","Chain 1: Iteration: 560 / 800 [ 70%]  (Sampling)\n","Chain 1: Iteration: 640 / 80